import React from 'react';
import '../styles/Header.css';
import logo from '../assets/logo-header.svg';
import cart from '../assets/mini-cart.svg';

const Header = () => (
  <header className="header">
    <img src={logo} alt="Digital Store" className='logoHeader'/>
    <div className="user-actions">
      <a id='a1' href="/cadastro">Cadastre-se</a>
      <a id='a2' href="/login"><button>Entrar</button></a>
      <a id='a3' href="/carrinho"><img src={cart} alt="Carrinho de compras"/></a>
    </div>
    
  </header>
);

export default Header;
